import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import TodoApp from './components/TodoApp'; // Main Todo app component
import Header from './components/Header'; // Optional header with navigation links

function App() {
  return (
    <Router>
      <Header /> {/* Include Header if needed */}
      <Routes>
        <Route path="/" element={<TodoApp />} />
      </Routes>
    </Router>
  );
}

export default App;
